        <>
         <div className="main_div">
             <div className="center_div">
                 <h1>My Daily Bucket</h1>
                 <br/>
                 <input type="text" placeholder="Input field" onChange={addItem}/>
                 <br/>
                 <button>Clear</button>
                 <button onClick={listOfItems}>Add item</button>

                 <ol>
                     <li>{presentData}</li>
                 </ol>

             </div>
         </div>


        </>

    );

};

